"""#Serilerde indexleme i≈ülemleri"""

import pandas as pd
import numpy as np

# Seri olu≈üturma
seri = pd.Series([10, 20, 30, 40, 50],
                 index=['a', 'b', 'c', 'd', 'e'])
print(seri)
# a    10
# b    20
# c    30
# d    40
# e    50
# dtype: int64

"""#Serilerde temel indexleme"""

# Tek bir deƒüere eri≈üim
print(seri['b'])  # 20

# Birden fazla deƒüere eri≈üim
print(seri[['a', 'c', 'e']])
# a    10
# c    30
# e    50
# dtype: int64

# Slice i≈ülemi
print(seri['b':'d'])
# b    20
# c    30
# d    40
# dtype: int64

"""#.loc ile indexleme"""

#.loc ile etiket bazlƒ± indexleme
# Tek etiket
print(seri.loc['c'])  # 30

# √áoklu etiketler
print(seri.loc[['a', 'd']])
# a    10
# d    40
# dtype: int64

# Slice i≈ülemi (dahil edicidir)
print(seri.loc['b':'d'])
# b    20
# c    30
# d    40
# dtype: int64

"""#.iloc ile indexleme"""

#.iloc ile pozisyon bazlƒ± indexleme
# Tek pozisyon
print(seri.iloc[2])  # 30

# √áoklu pozisyonlar
print(seri.iloc[[0, 3, 4]])
# a    10
# d    40
# e    50
# dtype: int64

# Slice i≈ülemi
print(seri.iloc[1:4])
# b    20
# c    30
# d    40
# dtype: int64

"""#Serilerde Ko≈üullu i≈ülemler"""

# Ko≈üula g√∂re filtreleme
seri = pd.Series([10, 25, 30, 45, 50],
                 index=['a', 'b', 'c', 'd', 'e'])

# 30'dan b√ºy√ºk deƒüerler
print(seri[seri > 30])
# d    45
# e    50
# dtype: int64

# √áoklu ko≈üullar
print(seri[(seri > 20) & (seri < 50)])
# b    25
# c    30
# d    45
# dtype: int64

# Belirli deƒüerlere e≈üit olma
print(seri[seri.isin([10, 30, 50])])
# a    10
# c    30
# e    50
# dtype: int64

"""#√áok Seviyeli ƒ∞ndex Olu≈üturma"""

# √áok seviyeli indeks olu≈üturma
arrays = [['A', 'A', 'B', 'B'], [1, 2, 1, 2]]
index = pd.MultiIndex.from_arrays(arrays, names=['letter', 'number'])
seri_multi = pd.Series([10, 20, 30, 40], index=index)

