# letter  number
# A       1         10
#         2         20
# B       1         30
#         2         40
# dtype: int64

# √áok seviyeli indeksleme
print(seri_multi.loc['A'])
# number
# 1    10
# 2    20
# dtype: int64

print(seri_multi.loc[('A', 2)])  # 20
print(seri_multi.xs('B', level='letter'))
# number
# 1    30
# 2    40
# dtype: int64

