"""# Series Bilgilendirme

* Series = Etiketli, tek boyutlu veri yapƒ±sƒ±
* Liste, s√∂zl√ºk veya NumPy dizisiyle olu≈üturulabilir.
* Her elemanƒ±n bir indeksi vardƒ±r (sayƒ±sal ya da metinsel).
* Matematiksel i≈ülemler, filtreleme, eksik veri y√∂netimi gibi √∂zellikler sunar.
* Pandas‚Äôƒ±n temel yapƒ± ta≈ülarƒ±ndan biridir.

#Serilerde Birle≈ütirme
Birden fazla Pandas Series‚Äôi (seriyi) tek bir Series h√¢line getirmek demektir.
Bu i≈ülem genellikle alt alta (dikey olarak) yapƒ±lƒ±r.

D√º≈ü√ºn ki:

Seri 1: [10, 20] ‚Üí indeksleri [a, b]
Seri 2: [30, 40] ‚Üí indeksleri [c, d]
Birle≈ütirirsen: [10, 20, 30, 40] ‚Üí indeksleri [a, b, c, d]

Pandas‚Äôda serileri (ve DataFrame‚Äôleri) birle≈ütirmek i√ßin pd.concat() fonksiyonu kullanƒ±lƒ±r.

`pd.concat([seri1, seri2, seri3, ...])`
"""

import pandas as pd

seri1 = pd.Series([1, 2], index=['a', 'b'])
seri2 = pd.Series([3, 4], index=['c', 'd'])

birlesik = pd.concat([seri1, seri2])
print(birlesik)

"""**Aynƒ± ƒ∞ndekse Sahip Serileri Birle≈ütirmek**
Eƒüer iki serinin aynƒ± indeks deƒüerleri varsa, concat bunlarƒ± ayrƒ± satƒ±rlar olarak ekler (yani yinelenen indekslere izin verir):
"""

seri1 = pd.Series([10, 20], index=['x', 'y'])
seri2 = pd.Series([30, 40], index=['x', 'y'])

sonuc = pd.concat([seri1, seri2])
print(sonuc)

 #yukarƒ±daki durumda indeksler yinelenir. Eƒüer bunu istemiyorsan, birle≈ütirme sonrasƒ± reset_index(drop=True) kullanabilirsin:

sonuc = pd.concat([seri1, seri2], ignore_index=True)
# √áƒ±ktƒ±: 0:10, 1:20, 2:30, 3:40
print(sonuc)

"""**Birden Fazla Seriyi Birle≈ütirme**"""

s1 = pd.Series([1])
s2 = pd.Series([2])
s3 = pd.Series([3])
s4 = pd.Series([4])

tum_seriler = pd.concat([s1, s2, s3, s4], ignore_index=True)
print(tum_seriler)

"""#Serileri Yanyana Birle≈ütirme

Seriler tek s√ºtunludur, bu y√ºzden concat ile yan yana birle≈ütirmek genellikle DataFrame olu≈üturur.
"""

seri1 = pd.Series([1, 2], name='A')
seri2 = pd.Series([3, 4], name='B')

df = pd.concat([seri1, seri2], axis=1)
print(df)
