"""# **pandas i≈ülemlerini test etmek i√ßin kullanabileceƒüimiz √∂rnek bir CSV dosyasƒ± olu≈üturalƒ±m**"""

import pandas as pd
import numpy as np
from datetime import datetime, timedelta
import random

# Rastgele veri olu≈üturma fonksiyonlarƒ±
def rastgele_tarih(baslangic=datetime(2023, 1, 1), bitis=datetime(2024, 1, 1)):
    """Rastgele tarih olu≈ütur"""
    fark = bitis - baslangic
    rastgele_gun = random.randint(0, fark.days)
    return baslangic + timedelta(days=rastgele_gun)

def rastgele_urun():
    """Rastgele √ºr√ºn adƒ± olu≈ütur"""
    urunler = ['Laptop', 'Telefon', 'Tablet', 'Kulaklƒ±k', 'Mouse', 'Klavye',
               'Monit√∂r', 'Yazƒ±cƒ±', 'Kamera', 'Hoparl√∂r', 'Hard Disk', 'SSD']
    return random.choice(urunler)

def rastgele_sehir():
    """Rastgele ≈üehir adƒ± olu≈ütur"""
    sehirler = ['ƒ∞stanbul', 'Ankara', 'ƒ∞zmir', 'Bursa', 'Antalya', 'Adana',
                'Konya', 'Gaziantep', 'Kayseri', 'Mersin', 'Diyarbakƒ±r', 'Eski≈üehir']
    return random.choice(sehirler)

def rastgele_kategori(urun):
    """√úr√ºne g√∂re kategori belirle"""
    kategori_map = {
        'Laptop': 'Elektronik', 'Telefon': 'Elektronik', 'Tablet': 'Elektronik',
        'Kulaklƒ±k': 'Aksesuar', 'Mouse': 'Aksesuar', 'Klavye': 'Aksesuar',
        'Monit√∂r': 'Donanƒ±m', 'Yazƒ±cƒ±': 'Donanƒ±m', 'Kamera': 'Elektronik',
        'Hoparl√∂r': 'Aksesuar', 'Hard Disk': 'Donanƒ±m', 'SSD': 'Donanƒ±m'
    }
    return kategori_map.get(urun, 'Diƒüer')

# Veri setini olu≈ütur
np.random.seed(42)  # Tekrarlanabilirlik i√ßin
random.seed(42)

satislar = []

for i in range(1000):
    urun = rastgele_urun()
    kategori = rastgele_kategori(urun)
    tarih = rastgele_tarih()
    sehir = rastgele_sehir()
    miktar = random.randint(1, 5)
    birim_fiyat = round(random.uniform(50, 2000), 2)
    toplam_tutar = round(miktar * birim_fiyat, 2)

    # Bazƒ± satƒ±rlarda eksik veri ekle (ger√ßek√ßilik i√ßin)
    musteri_yasi = random.randint(18, 70) if random.random() > 0.1 else np.nan
    musteri_cinsiyet = random.choice(['Erkek', 'Kadƒ±n']) if random.random() > 0.08 else np.nan

    satislar.append({
        'satis_id': i + 1,
        'musteri_id': f"M{random.randint(1000, 9999)}",
        'urun_adi': urun,
        'kategori': kategori,
        'miktar': miktar,
        'birim_fiyat': birim_fiyat,
        'toplam_tutar': toplam_tutar,
        'tarih': tarih.strftime('%Y-%m-%d'),
        'sehir': sehir,
        'musteri_yasi': musteri_yasi,
        'musteri_cinsiyet': musteri_cinsiyet,
        'odeme_tipi': random.choice(['Kredi Kartƒ±', 'Nakit', 'Havale']),
        'indirim_orani': round(random.uniform(0, 0.3), 2)  # %0-30 arasƒ± indirim
    })

# DataFrame olu≈ütur
df = pd.DataFrame(satislar)

# CSV dosyasƒ±na kaydet
df.to_csv('satis_verileri.csv', index=False, encoding='utf-8')

print("CSV dosyasƒ± ba≈üarƒ±yla olu≈üturuldu!")
print(f"Olu≈üturulan veri seti boyutu: {df.shape}")
print("\nƒ∞lk 5 satƒ±r:")
print(df.head())
print("\nVeri tipleri:")
print(df.dtypes)
print("\nTemel istatistikler:")
print(df.describe())

